import React, { useState } from 'react';

const ContactForm = () => {
    const [formData, setFormData] = useState({
        email: '',
        mobile: '',
        city: '',
        pincode: '',
        country: '',
        description: '',
        productCode: '',
        productName: '',
        title: '',
        company: '',
        landline: '',
        state: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Form Data:', formData);
        // Handle form submission logic here
    };

    return (
        <div>
            <form onSubmit={handleSubmit} style={styles.form}>
                <fieldset className="main" style={styles.fieldset}>
                    <legend style={styles.legend}>Contact Information</legend>
                    <label htmlFor="email">Email id:</label>
                    <input type="email" id="email" name="email" value={formData.email} onChange={handleChange} required style={styles.input} />
                    <label htmlFor="mobile">Mobile No:</label>
                    <input type="text" id="mobile" name="mobile" value={formData.mobile} onChange={handleChange} required style={styles.input} />
                    <label htmlFor="city">City:</label>
                    <input type="text" id="city" name="city" value={formData.city} onChange={handleChange} required style={styles.input} />
                    <label htmlFor="pincode">Pin Code:</label>
                    <input type="text" id="pincode" name="pincode" value={formData.pincode} onChange={handleChange} required style={styles.input} />
                    <label htmlFor="country">Country:</label>
                    <input type="text" id="country" name="country" value={formData.country} onChange={handleChange} required style={styles.input} />
                    <label htmlFor="description">Description:</label>
                    <textarea id="description" name="description" value={formData.description} onChange={handleChange} rows="4" required style={styles.textarea}></textarea>
                </fieldset>

                <fieldset className="prod" style={styles.fieldset}>
                    <legend style={styles.legend}>Product Information</legend>
                    <label htmlFor="productCode">Product Code:</label>
                    <input type="text" id="productCode" name="productCode" value={formData.productCode} onChange={handleChange} required style={styles.input} />
                    <label htmlFor="productName">Product Name:</label>
                    <input type="text" id="productName" name="productName" value={formData.productName} onChange={handleChange} required style={styles.input} />
                </fieldset>
                <fieldset style={styles.fieldset}>
                    <label htmlFor="title">Title (Mr./Ms.):</label>
                    <input type="text" id="title" name="title" value={formData.title} onChange={handleChange} required style={styles.input} />
                    <label htmlFor="company">Company Name:</label>
                    <input type="text" id="company" name="company" value={formData.company} onChange={handleChange} required style={styles.input} />
                    <label htmlFor="landline">Land Line No:</label>
                    <input type="text" id="landline" name="landline" value={formData.landline} onChange={handleChange} style={styles.input} />
                    <label htmlFor="state">State:</label>
                    <input type="text" id="state" name="state" value={formData.state} onChange={handleChange} required style={styles.input} />
                    <br />
                    <br />
                    <center>
                        <button type="submit" style={styles.submitButton}>Send Enquiry</button>
                    </center>
                </fieldset>
            </form>
        </div>
    );
};

const styles = {
    form: {
        maxWidth: '1000px',
        margin: '0 auto',
        backgroundColor: '#fff',
        padding: '30px',
        borderRadius: '8px',
        boxShadow: '0 2px 5px rgba(0, 0, 0, 0.1)',
    },
    fieldset: {
        border: '1px solid #ddd',
        padding: '15px',
        borderRadius: '8px',
        marginBottom: '20px',
    },
    legend: {
        fontWeight: 'bold',
        color: '#333',
    },
    input: {
        width: '100%',
        padding: '10px',
        fontSize: '16px',
        border: '1px solid #ccc',
        borderRadius: '5px',
        marginBottom: '10px',
        boxSizing: 'border-box',
    },
    textarea: {
        width: '100%',
        padding: '10px',
        fontSize: '16px',
        border: '1px solid #ccc',
        borderRadius: '5px',
        marginBottom: '10px',
        boxSizing: 'border-box',
        resize: 'vertical',
    },
    submitButton: {
        backgroundColor: '#007bff',
        color: '#fff',
        padding: '12px 20px',
        fontSize: '16px',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
    },
};

export default ContactForm;
